import React, { Component } from 'react';
import '../style/MyInput.css'

class MyInput extends Component {
    constructor() {
        super();

        this.state = {
            label: '',
            value: ''
        }
    }
    render () {
        return (
            <div className="Div-my-input">
                <span className="Label">{this.statelabel}</span>
                <input onChange={(event) => { this.setState({value:event.target.value}) }} className="My-input" value={this.state.value}/>
            </div>
        )
    }
}

export default MyInput;
